Jedno od omiljenih jela naše dece 😍 

Sastojci : 

za ćufte: 
- 1kg mlevenog mesa 
- 1 velika glavica crnog luka 
- 3 cena belog luka 
- 2 jaja 
- 3 kašike prezli 
- 150-200g sira gaude 
- lišće peršuna 
- vegeta 
- biber 
- malo ulja 

Za sos: 
- 1 sos bolognese Podravka ili 500ml gustog soka od paradajza 
- 400 ml mleka 
- 500-600 ml vode 
- 3 kašike brašna 
- 1-2 kašike slatke mlevene crvene paprike 
- vegeta 
- bosiljak 

Priprema: 

1. U secku iseckati sitno luk, beli luk i lišće peršuna. U dublju činiju staviti meso i dodati iseckanu mešavinu luka i peršuna. Dodati jaje, prezle, vegetu, biber i dobro rukom izmešati. 
2. Sir iseckati na kockice ne veće od 1cm x 1cm. Uzimati po malo mesa oblikovati u malu pljeskavicu i preko staviti sir. Formirati ćufticu tako da je sir u sredini. 
3. Veličinu ćuftica odredite sami. Ja volim da su male, tako da sam od ove količine mesa dobila 42 ćuftice. 
4. Ćufte na kratko sa svih strana propržiti na malo ulja, dok ne dobiju smeđu boju. 
5. Bolonjeze sos ili paradajz sok zagrejati u šerpi i dodati brašno i crvenu papriku uz mešanje. Promešati i naliti sa mlekom i vodom. Začiniti i mešati dok ne prokljuca. Dublju tepsiju, keramičku ili glinenu posudu nauljiti malo i poređati ćuftice. Preliti sa sosom tako da se ćufte prekriju. Ubaciti malo bosiljka, poklopiti i staviti u rernu da se krcka oko 1h na 220-250C ( sve zavisi od rerne ). 

P.S. Ako nemate dovoljno sosa dodajte malo vode i vegete još ako treba. Sos treba da je malo ređi jer će tokom kuvanja ispariti malo i zgusnuti se. 

Prijatno! 👩🏻‍🍳

